import React from 'react'
import './About.css'

export default function About() {
    return (
        <div>
            <div className="About">
                <p> About Me </p>
                <p> Working as a full stack web developer for about 1 year. I have created several websites specially for a school website, an organization's portfolio, an online store website 

                </p>


            </div>
        </div>
    )
}
